/*!50003 CREATE*/ /*!50017 DEFINER=`avnadmin`@`%`*/ /*!50003 TRIGGER `send_notification_to_admin` AFTER INSERT ON `Orders` FOR EACH ROW BEGIN
    DECLARE done INT DEFAULT 0;
    DECLARE admin_userID INT;

    -- Con tr·ªè ƒë·ªÉ duy·ªát qua t·∫•t c·∫£ userID c·ªßa admin
    DECLARE admin_cursor CURSOR FOR
        SELECT u.userID
        FROM User u
        JOIN Account a ON u.accountID = a.accountID
        WHERE a.role = 'ADMIN';

    -- X·ª≠ l√Ω k·∫øt th√∫c con tr·ªè
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

    -- M·ªü con tr·ªè
    OPEN admin_cursor;

    admin_loop: LOOP
        FETCH admin_cursor INTO admin_userID;
        IF done THEN
            LEAVE admin_loop;
        END IF;

        -- Th√™m th√¥ng b√°o v√†o b·∫£ng Notify
        INSERT INTO Notify (timeStamp, content, userID)
        VALUES (NOW(), CONCAT('C√≥ ƒë∆°n h√†ng m·ªõi v·ªõi m√£ ƒë∆°n h√†ng: ', NEW.orderId), admin_userID);
    END LOOP;

    -- ƒê√≥ng con tr·ªè
    CLOSE admin_cursor;
END */;;
DELIMITER ;
