/*!50003 CREATE*/ /*!50017 DEFINER=`avnadmin`@`%`*/ /*!50003 TRIGGER `send_notification_to_customer` AFTER UPDATE ON `Orders` FOR EACH ROW BEGIN
    -- Ki·ªÉm tra n·∫øu tr·∫°ng th√°i c·ªßa ƒë∆°n h√†ng ƒë√£ ƒë∆∞·ª£c thay ƒë·ªïi th√†nh 'CONFIRMED'
    IF NEW.orderStatus = 'CONFIRMED' AND OLD.orderStatus != 'CONFIRMED' AND NEW.customerID  THEN
        -- Th√™m th√¥ng b√°o v√†o b·∫£ng Notify cho kh√°ch h√†ng
        INSERT INTO Notify (timeStamp, content, userID)
        VALUES (NOW(), CONCAT('ƒê∆°n h√†ng c·ªßa b·∫°n v·ªõi m√£ ƒë∆°n h√†ng: ', NEW.orderId, ' ƒë√£ ƒë∆∞·ª£c duy·ªát.'), NEW.customerID);
    END IF;
END */;;
